export const coute = [
    {
        id:"1",
        coute:"The first of the Gurus and the founder of the Sikh religion was Guru Nanak. He was born at Talwandi (now known as Nankana Sahib in Pakistan) on October 20, 1469.",
        image:"/guru1.jpg",
        name:"Guru Nanak Dev Ji"
    },
    {
        id:"2",
        coute:" He was born in 1479. Guru Amardas took up cudgels of spirituality to fight against caste restrictions, caste prejudices and the curse of untouchability.",
        image:"/guru2.jpg",
        name:"Guru Amar Das Sahib Ji"
    },
    {
        id:"3",
        coute:" He was born in 1534. Guru ji founded the city of Amritsar and started the construction of the famous Golden Temple at Amritsar, the holy city of the Sikhs. He requested the, Muslim Sufi, Mian Mir to lay the cornerstone of the Harmandir Sahib.",
        image:"/guru3.jpg",
        name:"Guru Ram Das Sahib Ji"
    },
    {
        id:"4",
        coute:"He was born in 1563. He was the third son of Guru Ram Das ji. Guru Arjan was a saint and scholar of the highest quality and repute.",
        image:"/guru4.jpg",
        name:"Guru Arjan Dev Ji"
    },
    {
        id:"5",
        coute:`He was born in 1595. He was the son of Guru Arjan Dev and was known as a "soldier saint," Guru Hargobind ji organised a small army, explaining that extreme non-violence and pacifism would only encourage evil and so the principles of Miri-Piri were established.`,
        image:"/guru5.jpg",
        name:" Guru Har Gobind Sahib Ji"
    },
    {
        id:"6",
        coute:`He was born in 1630, spent most of his life in devotional meditation and preaching the teachings of Guru Nanak. `,
        image:"/guru6.jpg",
        name:"Guru Har Rai Sahib Ji"
    },
    {
        id:"7",
        coute:` He was born in 1656. Guru Har Krishan was the youngest of the Gurus. Installed as Guru at the age of five, Guru ji astonished the Brahmin Pundits with his knowledge and spiritual powers.`,
        image:"/guru7.jpg",
        name:" Guru Har Krishan Sahib Ji"
    },
    {
        id:"8",
        coute:"He established the town of Anandpur. The Guru laid down his life for the protection of the Hindu religion, their Tilak (devotional forehead markings) and their sacred (janeau) thread. He was a firm believer in the right of people to the freedom of worship. ",
        image:"/guru8.jpg",
        name:"Guru Tegh Bahadur Sahib Ji"
    },
    {
        id:"9",
        coute:"He created the Khalsa (The Pure Ones) in 1699, changing the Sikhs into a saint-soldier order with special symbols and sacraments for protecting themselves. After the Guru had administered Amrit to his Five Beloved Ones, he stood up in supplication and with folded hands, begged them to baptize him in the same way as he had baptized them. He himself became their disciple (Wonderful is Guru Gobind Singh, himself the Master and himself the disciple).",
        image:"/guru9.jpg",
        name:" Guru Gobind Singh Sahib Ji"
    },
]
